syntax = "proto3";
package wiradata.warehouses;

option go_package = "pb;warehouses";

import "google/protobuf/timestamp.proto";
import "warehouse_message.proto"";
"
message Shelve {
  string id = 1;
  Warehouse warehouse = 2;
  string code = 3;
  string name = 4;
  google.protobuf.Timestamp created_at = 5;
  string created_by = 6;
  google.protobuf.Timestamp updated_at = 7;
  string updated_by = 8;
}